import React, { Component } from "react";
import styles from './AddBuilding.module.css';


class AddBuilding extends Component {

  async  addBuildingHandler() {
    const requestOptions = {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ title: 'React POST Request Example' })
  };
  fetch('http://localhost:8080/api', requestOptions);
  }


  render(){
  return (
    <div className={styles.container}>
      <h1>Add new Building</h1>

      <input type="text" placeholder="Enter Name" name="name" id="name" required/>
      <div></div>
      <input type="number" min="0" placeholder="Enter capacity" name="cap" id="cap"  required/>
      <div></div>
      <button type="submit" className={styles.addBuildingBtn} onClick={this.addBuildingHandler}>Add</button>
    </div>
  );
  }
}

export default AddBuilding;
